description:
Izaki is a young lad who loves cakes. He currently works in a cake shop, which he deems has &quot;flavor that is unrivaled!&quot; But, Takara, the p&acirc;tissier who makes the cakes is an abnormally unsocial guy. Since Takara is the son of the world famous p&acirc;tissier, he completely distrusts others because he is used to being compared to his father and being used by others.

Takara is completely charmed by Izaki who honestly tells him: &quot;I have no interest in you, but the cakes that you make are superb!&quot;

Takara confesses his feelings to Izaki, but instead Izaki is completely turned off by it&hellip;!?

My senpai is super-hot, super-popular, and a super-model. Rumor has it that he always invites his target to the library and ravishes that person right there and then&hellip;
Which is why I was totally shocked when he suddenly asked me to join him at the library!?&mdash; I&rsquo;m ecstatic!!!
My body is already burning in anticipation&mdash;!

&quot;The Green Bird of Happiness&quot;

Its figure was as divine as the phoenix of legends, and the timbre of its songs was more majestic than any instrument.
It's said that if you were to encounter it, you will be promised happiness...

&quot;Come on, kill all those bandits for me already!&quot; 
&quot;No thanks. I don't wanna do any work.&quot; 
My name is Keima Masuda, and my hobby is spending each day doing exactly nothing... but one fateful night, I was summoned to another world where I met a blonde young girl who I named Rokuko. It seemed that fortune had favored me and I would soon be living a wonderful life free of work. But even though I'm a guy who loves sleeping more than eating, Rokuko demanded that I help her. 
&quot;Save my dungeon! By the way, since you're the Dungeon Master, you'll die too if the Dungeon Core is destroyed.&quot; 
The dungeon only had one room, and it was already surrounded by bandits. Seriously? It's a checkmate already. I've gotta break out of this impossible situation so I can stop working and just sleep!

