[spoiler]Paresseux au possible, amoureux d&rsquo;une bonne nuit de sommeil, me voil&agrave; invoqu&eacute; dans un autre monde par une esp&egrave;ce de loli blonde. Et elle me demande d&rsquo;aller affronter des bandits pour sauver son donjon. Et si jamais ces bandits d&eacute;truisent le c&oelig;ur du donjon, en tant que ma&icirc;tre du donjon, je perdrai &eacute;galement la vie&hellip; Je n&rsquo;ai aucune chance de survivre, ou quoi ? &hellip;Essayons de faire en sorte que je puisse de nouveau ne plus avoir &agrave; travailler ![/spoiler]
