One day, a martial artist named Ash was suddenly reborn into another world. He decided that he will become a sorcerer in his second life. He went through harsh training after becoming the apprentice of the former hero, Morris. Then, the &quot;Emperor of Darkness&quot; suddenly appeared! Right when the end of the world was approaching, he one-shot the Demon Lord?!

[u][b]French / Fran&ccedil;ais:[/b][/u]
[spoiler]Ce n'&eacute;tait pas de la magie. C'&eacute;tait une attaque physique&hellip;

Un jour, un pratiquant des arts martiaux pr&eacute;nomm&eacute; Ash, se voit rena&icirc;tre dans un nouveau-n&eacute;, et dans un autre monde empli de magie et d'&eacute;p&eacute;es. Il a donc d&eacute;cid&eacute; de tout faire afin de devenir un grand sorcier aguerri dans sa seconde vie. Il va donc subir un s&eacute;v&egrave;re entra&icirc;nement, avec son ma&icirc;tre, Morris. Mais c'est alors, que L'empereur des t&eacute;n&egrave;bres apparu devant lui pendant qu'il s'entra&icirc;nait avec son ma&icirc;tre.[/spoiler]

As the towns and cities grow, the people who have Ascended to immortals disguise themselves as mortals in the cities, part of them can&rsquo;t help themselves but to devour humans, but other than these cases showing up in headlines and on the news, there aren&rsquo;t any other effects.
Because of this, monsters and demons are almost extinct, and Gods rarely descend to the mortal realm. In the mortal realm there are Ascended who know the rules of the mortals, but few still disrupt those rules, Gods descend to deal with demons from time to time.
Even though some Ascended do descend to the mortal realm as they miss the realm, they still do have their own goals to achieve, so the Heavens sends Guardian Gods to return those Ascended, and also to keep them from harming the mortal realm&hellip;

&quot;Si je te mets enceinte, tu seras oblig&eacute;e de te marier avec moi&quot;
Le gar&ccedil;on qui appara&icirc;t soudainement devant Rin est son fianc&eacute;?! Mais sa vraie forme est celle d'un d&eacute;mon mangeur d'homme?
Rin, &eacute;lev&eacute;e par son fr&egrave;re &agrave; la mort de ses parents, rencontre un nouvel &eacute;l&egrave;ve, Suo Kusa.
Il embrasse sa marque de naissance lui disant &quot;Je t'ai enfin trouv&eacute;e!&quot;
Il lui dit qu'il sont amis d'enfance et qu'il est revenue expr&egrave;s pour elle, mais elle ne se souvient de rien.

There was a confession letter in the time capsule that my childhood friend and I buried. While office worker Buntarou is on his way to his hometown for summer vacation, he reunites with his childhood friend, Ittetsu,  with whom he hasn&rsquo;t spoken in fourteen years.
Inspired by the letters from the time capsule, Buntarou and Ittetsu entwine their bodies as they start a relationship that they call a &ldquo;thoughtless love affair&rdquo;&hellip;
This summer&rsquo;s encounters will heal the wounds that they&rsquo;ve carried in their hearts without knowing it.

One day, a tiny girl named Shina appeared inside a roll of toilet paper in the Yamaguchi's residence toilet. She made a stunning impression on a typical middle school student, Nobuo.

&quot;What if I use up all of the paper? Would I be able to see her... na... na... naked?!&quot;

It's the beginning of a story about love, lust and... a sh*t ton of other adventures!
